(10, '<p>What percentage of total cases of wine sold over the four year period were rose?<br></p>', 0, 4, 1, 2, 3, NULL, NULL),
(11, '<p><span style="color: rgb(0, 0, 0); font-family: verdana, ''Times New Roman'', Times, serif; line-height: normal; text-align: justify; background-color: rgb(255, 255, 255);">Suppose effort allocation is interchanged between operations B and C, then C and D, and then D and E and if companies are then ranked in ascending order of effort in E, what will be the rank of company 3?&nbsp;</span><br></p>', 0, 15, 1, 1, 4, NULL, NULL),
(12, '<p><span style="color: rgb(0, 0, 0); font-family: verdana, ''Times New Roman'', Times, serif; line-height: normal; text-align: justify; background-color: rgb(255, 255, 255);">A new technology is introduced in company 4 such that the total effort for operations B through F gets evenly distributed among these. What is the change in the percentage of effort in operation E?</span></p><p><span style="color: rgb(0, 0, 0); font-family: verdana, ''Times New Roman'', Times, serif; line-height: normal; text-align: justify; background-color: rgb(255, 255, 255);"><br></span><br></p>', 0, 15, 1, 1, 4, NULL, NULL),
(13, '<p><span style="color: rgb(0, 0, 0); font-family: verdana, ''Times New Roman'', Times, serif; line-height: normal; text-align: justify; background-color: rgb(255, 255, 255);">Suppose the companies find that they can remove operations B, C and D and re-distribute the effort released equally among the remaining operations. Then, which operation will show the maximum effort across all companies and all operations?</span><br></p>', 0, 14, 1, 1, 4, NULL, NULL),
(14, '<p><span style="color: rgb(0, 0, 0); font-family: verdana, ''Times New Roman'', Times, serif; line-height: normal; text-align: justify; background-color: rgb(255, 255, 255);">The country, which has the highest average price, is&nbsp;</span><br></p>', 0, 0, 1, 1, 5, NULL, NULL),
(15, '<p><span style="color: rgb(0, 0, 0); font-family: verdana, ''Times New Roman'', Times, serif; line-height: normal; text-align: justify; background-color: rgb(255, 255, 255);">The average price in Euro/ kg for Turkey is roughly&nbsp;</span><br></p>', 0, 0, 1, 1, 5, NULL, NULL),
(16, '<p><strong style="margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: ''Open Sans'', Arial, Helvetica, sans-serif; font-size: 13px; line-height: 22px; background-color: rgb(255, 255, 255);">What is the average value of the contract secured during the years shown in the diagram?</strong><br></p>', 0, 16, 1, 1, 6, NULL, NULL),
(17, '<p><strong style="margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: ''Open Sans'', Arial, Helvetica, sans-serif; font-size: 13px; line-height: 22px; background-color: rgb(255, 255, 255);">Compared to the performance in 1985 (i.e. taking it as the base), what can you say about the performances in the years ’84, ’85, ’86, ’87, ’88 respectively, in percentage terms?</strong><br></p>', 0, 16, 1, 1, 6, NULL, NULL),
(18, '<p><strong style="margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: ''Open Sans'', Arial, Helvetica, sans-serif; font-size: 13px; line-height: 22px; background-color: rgb(255, 255, 255);">Which is the year in which the highest percentage decline is seen in the value of contract secured compared to the preceding year?</strong><br></p>', 0, 16, 1, 1, 6, NULL, NULL),
(19, '<p><strong style="margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: ''Open Sans'', Arial, Helvetica, sans-serif; font-size: 13px; line-height: 22px; background-color: rgb(255, 255, 255);">The total expenditure is required to be kept within Rs. 700 lakh by cutting the expenditure on administration equally in all the years. What will be the percentage cut for 1989?</strong><br></p>', 0, 13, 1, 1, 7, NULL, NULL),
(20, '<p><span style="color: rgb(102, 102, 102); font-family: ''Open Sans'', Arial, Helvetica, sans-serif; font-size: 13px; line-height: 22px; background-color: rgb(255, 255, 255);">If the length of line to be laid each year is in proportion to the estimated cost for material and labour, what fraction of the total length is proposed to be completed by the third year?</span><br></p>', 0, 13, 1, 1, 7, NULL, NULL),
(21, '<p><strong style="margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: ''Open Sans'', Arial, Helvetica, sans-serif; font-size: 13px; line-height: 22px; background-color: rgb(255, 255, 255);">What is the approximate ratio of the total cost of materials for all the years bear to the total labour cost?</strong><br></p>', 0, 13, 1, 1, 7, NULL, NULL),
(22, '<p><strong style="margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: ''Open Sans'', Arial, Helvetica, sans-serif; font-size: 13px; line-height: 22px; background-color: rgb(255, 255, 255);">If the cost of materials rises by 5% each year from 1990 onwards, by how much will the estimated cost rise?</strong><br></p>', 0, 13, 1, 1, 7, NULL, NULL),
(23, '<p><strong style="margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: ''Open Sans'', Arial, Helvetica, sans-serif; font-size: 13px; line-height: 22px; background-color: rgb(255, 255, 255);">&nbsp;It is found at the end of 1990, that the entire amount estimated for the project has been spent. If for 1991, the actual amount spent was equal to that which was estimated, by what percent (approximately) has the actual expenditure exceeded the estimated expenditure?</strong><br></p>', 0, 13, 1, 1, 7, NULL, NULL),
