(46, '<p>class HappyGarbage01&nbsp;</p><p>{&nbsp;</p><p>&nbsp; &nbsp; public static void main(String args[])&nbsp;</p><p>&nbsp; &nbsp; {</p><p>&nbsp; &nbsp; &nbsp; &nbsp; HappyGarbage01 h = new HappyGarbage01();&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; h.methodA(); /* Line 6 */</p><p>&nbsp; &nbsp; }&nbsp;</p><p>&nbsp; &nbsp; Object methodA()&nbsp;</p><p>&nbsp; &nbsp; {</p><p>&nbsp; &nbsp; &nbsp; &nbsp; Object obj1 = new Object();&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; Object [] obj2 = new Object[1];&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; obj2[0] = obj1;&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; obj1 = null;&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; return obj2[0];&nbsp;</p><p>&nbsp; &nbsp; }&nbsp;</p><p>}</p><p><br></p><p>Where will be the most chance of the garbage collector being invoked?<br></p>', 0, 0, 1, 2, 16, '2014-10-06 00:46:18', '2014-10-06 00:46:18'),
(47, '<p>public class X&nbsp;</p><p>{</p><p>&nbsp; &nbsp; public static void main(String [] args)&nbsp;</p><p>&nbsp; &nbsp; {</p><p>&nbsp; &nbsp; &nbsp; &nbsp; X x = new X();</p><p>&nbsp; &nbsp; &nbsp; &nbsp; X x2 = m1(x); /* Line 6 */</p><p>&nbsp; &nbsp; &nbsp; &nbsp; X x4 = new X();</p><p>&nbsp; &nbsp; &nbsp; &nbsp; x2 = x4; /* Line 8 */</p><p>&nbsp; &nbsp; &nbsp; &nbsp; doComplexStuff();</p><p>&nbsp; &nbsp; }</p><p>&nbsp; &nbsp; static X m1(X mx)&nbsp;</p><p>&nbsp; &nbsp; {</p><p>&nbsp; &nbsp; &nbsp; &nbsp; mx = new X();</p><p>&nbsp; &nbsp; &nbsp; &nbsp; return mx;</p><p>&nbsp; &nbsp; }</p><p>}</p><p><br></p><p>After line 8 runs. how many objects are eligible for garbage collection?<br></p>', 0, 0, 1, 2, 16, '2014-10-06 00:46:18', '2014-10-06 00:46:18');
