(2, 'aptitude question', 'Answer Question (1-4) on the basis of the information given in the below table:', '<p>The table above shows the specializations of North West Medical School graduates in 2005. Percentages have been rounded to the nearest whole number. One hundred and nineteen students graduated that year.</p><div><br></div><img src="data:image/jpeg;base64," data-filename="image.jpg" style="width: 413px;"><p><br></p>', 5, NULL, NULL);
