(4, '', 'Answer following questions.', '<p><span style="color: rgb(0, 0, 0); font-family: verdana, ''Times New Roman'', Times, serif; line-height: normal; text-align: justify;">There are six companies, 1 through 6. All of these companies use six operations, A through F. The following graph shows the distribution of efforts put in by each company in these operations.&nbsp;</span></p><p><img src="http://www.mbarendezvous.com/cat2013img/comquestions.jpg" style="line-height: 1.42857143; width: 568px;"><br></p><p><br></p>', 17, NULL, NULL),
(5, NULL, 'Answer the questions based on the pie charts given below:', '<p style="text-align: center; "><span style="color: rgb(0, 0, 0); font-family: verdana, ''Times New Roman'', Times, serif; line-height: normal; text-align: justify;"><br></span></p><img src="http://www.mbarendezvous.com/cat2013img/piechart.jpg" style="width: 672px;"><p><span style="color: rgb(0, 0, 0); font-family: verdana, ''Times New Roman'', Times, serif; line-height: normal; text-align: justify;"><br></span></p><p><span style="color: rgb(0, 0, 0); font-family: verdana, ''Times New Roman'', Times, serif; line-height: normal; text-align: justify;">Chart-1 shows the distribution by value of top 6 suppliers of MFA Textiles in 1995. Chart-2 shows the distribution by quantity of top 6 suppliers of MFA textiles in 1995. The total value is 5760 million Euros (the European currency). The total quantity is 1.055 million tonnes.&nbsp;</span><br></p>', 17, NULL, NULL),
(6, 'DI barchart question', 'Refer to the following Bar-chart and answer the questions that follow:', '<p><img src="http://cat.wordpandit.com/wp-content/uploads/2013/08/di-set-1-question.png" style="line-height: 1.42857143; width: 732px;"><br></p><p><br></p>', 16, NULL, NULL),
(7, NULL, 'The table below shows the estimated cost (in Rs. Lakh) of a project of laying a railway line between two places.', '<p><br></p><img src="http://cat.wordpandit.com/wp-content/uploads/2013/08/di-set-2-question.png" style="width: 808px;"><p><br></p>', 13, NULL, NULL),
